import React from "react";

export const Tile = ({ name, appointment }) => {
  return (
    <div className="tile-container">
      <p className="tile-title tile">{name}</p>
      <p className="tile">Contact: {appointmentDetails.contact}</p>
      <p className="tile">Date: {appointmentDetails.date}</p>
      <p className="tile">Time: {appointmentDetails.time}</p>
      <p className="tile">Reason: {appointment.reason}</p>      
    </div>
  );
}
